import styled from 'styled-components';
import Responsive from './Responsive';
import Button from './Button';

const HeaderBlock = styled.div`
  position: fixed;
  width: 100%;
  background: white;
  box-shodow: 0px 2px 4px rgba(0, 0, 0, 0.08);
`;

const Wrapper = styled(Responsive)`
  height: 4rem;
  display: flex;
  align-itemns: center;
  justify-content: space-between;
  .logo {
    font-size: 1.125;
    font-weight: 800;
    letter-spacing: 2px;
  }
`;
const Spacer = styled.div`
  height: 4rem;
`;
const Header = () => {
  return (
    <>
      <HeaderBlock>
        <Wrapper>
          <div className="logo">EcoWeb</div>
          <div className="right">
            <Button> 로그인</Button>
          </div>
        </Wrapper>
      </HeaderBlock>
      <Spacer />
    </>
  );
};

export default Header;
